INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (2, "青空の下で謁見", 7, 5118061, 0, 0, 1, 10118, 8, 91002, 40, "ペコリーヌとの出会い", 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (2, "未来の騎空団\nマスコット？", 7, 5118062, 0, 0, 1, 10118, 8, 91002, 40, "マホとの出会い", 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (2, "お嬢さまからの\n緊急依頼", 7, 5118063, 0, 0, 1, 10118, 8, 91002, 40, "アキノとの出会い", 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (2, "黄金色の悩みごと", 18, 5118064, 0, 0, 1, 10118, 8, 91002, 40, "ジュンとの出会い", 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (2, "白熱！　格闘大会！", 18, 5118065, 0, 0, 1, 10118, 8, 91002, 40, "カオリとの出会い", 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (2, "祭り太鼓はオーエドの華", 16, 5118066, 0, 1, 1, 10118, 8, 91002, 40, "ニノンとの出会い", 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (3, "人気者は遅れて\nやってくる", 19, 5118067, 0, 0, 1, 10118, 8, 91002, 40, "スズナとの出会い", 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (3, "巫女・ミーツ・魔法少女", 18, 5118068, 0, 0, 1, 10118, 8, 91002, 40, "ナナカとの出会い", 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (3, "ネズ耳は二度なくなる", 18, 5118069, 0, 0, 1, 10118, 8, 91002, 40, "キャル＆コッコロとの出会い", 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (3, "この出会いにカンパイ！", 18, 5118070, 0, 0, 1, 10118, 8, 91002, 40, "ユカリとの出会い", 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (3, "陰陽アンサンブル", 18, 5118071, 0, 0, 1, 10118, 8, 91002, 40, "アオイとの出会い", 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (3, "運試し十番勝負！", 7, 5118072, 0, 1, 1, 10118, 8, 91002, 40, "シノブとの出会い", 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場");
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (1, "彼女たちの新たな日常", 0, 5118600, 10145115, 0, 0, 10118, 0, 0, 0, "オープニング", 0, 0, 0);
